import React from 'react';
import './Marker.css';

const Marker = (props) => {
    const { color, name, id } = props;
    return (
      <div>

        <div
          className="pin bounce"
          style={{ backgroundColor: color, cursor: 'pointer' }}
          title={name}
        />
        <div className="pulse" />
        <br/>
        <br/>
        <p>
          <font size="6"
          face="verdana"
          color="green">
            GeeksforGeeks!
        </font>
          {name}
        </p>

      </div>
    );
  };

  export default Marker;
